import React from "react";
import User from './images/u.png'
import Ups from './images/ups.png'

function App() {
  return (
    <div className="bg-white">
      <nav className="bg-white relative h-24">
        <img src={Ups} className="translate-y-6 h-14 translate-x-56"/>
        <div  className="flex h-14 justify-end">
          <img src={User} className="mt-4 -translate-y-12 flex justify-center mr-40 bg-yellow-400  bg-auto rounded-full"><a>Sign In</a></img>
        </div>
      </nav>
    </div>
  );
}

export default App;
